import logo from './vecteezy_valentine-day-love-letter-envelope_22034135_962.png';
import './App.css';

function App() {
  const handleClick = () => {
    alert('Image clicked!');
  };

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" onClick={handleClick} />
      </header>
    </div>
  );
}


export default App;
